  input: TEXT,F3XA,,"Payments received on Schedule A, Line 15, as operating refunds
    from the individuals listed are repayments for food and beverage costs incurred
    at the Committee's meeting of the board of directors.  The payment from Triangle
    Marketing Service is an offset to direct mail expenses in the form of publicly
    trade list rental.  The Metro DC Community Center reimbursed the Committee for
    moving expenses associated with used furniture donation.  In response to the Commission's
    request for additional information concerning the full identification of contributors,
    please note the Committees follows the 'best efforts' guidelines in request information
    when contributions are solicited, making follow-up requests notifying the contributors
    that federal law requires the information to be reported, and disclosing any information
    received as is done in this amendment. Please note that a contributor's employer
    and occupation is not required for earmarked contributions that do not excess
    $200.  Disbursements made for direct mail, fundraising advertisements, and telemarketing
    itemized on Schedule B, Line 21b, are operating expenditures of the Committee.  Any
    such expenditures that are allocable to a federal candidate are reported as an
    in-kind contribution or independent expenditure."
